import React from 'react'
import AddPost from './AddPost'
import AdminNavBar from './AdminNavBar'

function Adminpanel() {
    return (
        <div>
            <AdminNavBar/>
            
            <Route exact path='//AdminPanel' component={AddPost}/>
            
        </div>
    )
}

export default Adminpanel
